import React, { Component } from "react";
// import rp from 'request-promise';
import axios from 'axios';
import "./infobar.css";

class Infobar extends Component{
    constructor(prop){
        super(prop);
        this.state = {
            coin: []
        };
    }

    componentDidMount(){
        var api_key = process.env.API_KEY;
        axios.get(`https://min-api.cryptocompare.com/data/top/volumes?tsym=BTC&api_key=${api_key}`)
            .then(response => {
                console.log(response);
                this.setState({
                    coin: response.data.Data[0]
                })
            }).catch(() => console.log('Someting going wrong'));

        // let config = {
        //     'Authorization': '776194b8-0b73-4227-9b92-cc67fbed4dcf',
        // };

        // axios.get('https://pro-api.coinmarketcap.com/v1/cryptocurrency/info', {headers: config})
        //     .then(response => {
        //         console.log(response);
        //     }).catch(() => console.log('Someting going wrong'));

    }

    render(){

        let storing = this.state.coin.SYMBOL;
        return(
            <div>
            {storing}
            </div>
        )
    }
}

export default Infobar;
